long_desc.thetext:
When the onselect eventlistener of the window is blocked the bug is not present:

    w1.addEventListener("appear", function() {
    	this.getElement().onselectstart = qx.lang.Function.returnFalse;
   	});

The solution would be to block the onselect event during resize and movement of the window and restore the onselect event on move and resize termination.
